    "kvkk_url" : MessageLookupByLibrary.simpleMessage("https://www.guven.com.tr/online-doktor-e-konsultasyon/kvkk-aydinlatma-metni"),
    "kvkk_url_text" : MessageLookupByLibrary.simpleMessage("Remzi Oğuz Arık Mahallesi Paris Cad. No:58 Çankaya Ankara adresinde mukim Güven Hastanesi A.Ş. olarak kişisel verilerinizin gizliğine ve korunmasına büyük önem veriyoruz. 6698 sayılı Kişisel Verilerin Korunması Kanunu (KVKK) kapsamında kişisel veri politikalarımız hakkında sizleri bilgilendirmek isteriz. \n\nYürüttüğümüz faaliyet sırasında sizden aldığımız kişisel bilgileriniz bakımından Veri Sorumlusu olarak addedilmekteyiz. Veri Sorumlusu olarak, kişisel bilgileriniz aşağıda açıklandığı çerçevede sözlü, yazılı veya elektronik ortamda kaydedilebilecek, saklanabilecek, güncellenebilecek, sınıflandırılabilecek, mevzuatın izin verdiği hallerde 3. kişilere ve/veya yurt dışına açıklanabilecek ve/veya devredilebilecek ve KVKK’da sayılan diğer şekillerde işlenebilecektir.\n\nKişisel verilerin işlenme amaçları ve hukuki sebepleri; elektronik veya kâğıt ortamında işleme dayanak olacak tüm kayıt ve belgeleri düzenlemek; mevzuat ve ilgili otoritelerce öngörülen bilgi saklama, raporlama, bilgilendirme yükümlülüklerine uymak; talep edilen ürün ve hizmetlerini sunabilmek ve akdettiğiniz sözleşmenin gereğini alacağınız ürün veya hizmetleri yerine getirmektir.\n\nMüşterilerimize daha iyi hizmet verebilmek amacıyla bazı kişisel bilgilerinizi (isim, yaş, ilgi alanlarınız, e-posta vb.) sizlerden talep etmekteyiz. Sunucularımızda toplanan bu bilgiler, dönemsel kampanya çalışmaları, müşteri profillerine yönelik özel promosyon faaliyetlerinin kurgulanması ve istenmeyen e-postaların iletilmemesine yönelik müşteri “sınıflandırma” ve kişisel bilgiler vasıtasıyla oluşturulacak reklam, tanıtım, pazarlama faaliyetlerinin devam etmesi amacıyla saklanmakta ve bu amaçlarla kullanılmaktadır.\n\nWeb sitesi ve mobil uygulamalar üzerinden alışveriş yapanın/yaptıranın kimlik bilgilerini teyit etmek, iletişim için adres ve diğer gerekli bilgileri kaydetmek, mesafeli satış sözleşmesi ve Tüketicinin Korunması Hakkında Kanunun ilgili maddeleri tahtında akdettiğimiz sözleşmelerin koşulları, güncel durumu ve güncellemeler ile ilgili müşterilerimiz ile iletişime geçmek, gerekli bilgilendirmeleri yapabilmek, elektronik (internet/mobil vs.) veya kağıt ortamında işleme dayanak olacak tüm kayıt ve belgeleri düzenlemek, mesafeli satış sözleşmesi ve Tüketicinin Korunması Hakkında Kanunun ilgili maddeleri tahtında akdettiğimiz sözleşmeler uyarınca üstlenilen yükümlülükleri ifa etmek, Kamu güvenliğine ilişkin hususlarda talep halinde ve mevzuat gereği kamu görevlilerine bilgi verebilmek, Müşterilerimize daha iyi bir alışveriş deneyimini sağlamak, müşterilerimizin ilgi alanlarını dikkate alarak müşterilerimizin ilgilenebileceği ürünlerimiz hakkında müşterilerimize bilgi verebilmek, kampanyaları aktarmak, Müşteri memnuniyetini artırmak, web sitesi ve/veya mobil uygulamalardan alışveriş yapan müşterilerimizi tanıyabilmek ve müşteri çevresi analizinde kullanabilmek, çeşitli pazarlama ve reklam faaliyetlerinde kullanabilmek ve bu kapsamda anlaşmalı kuruluşlar aracılığıyla elektronik ortamda ve/veya fiziki ortamda anketler düzenlemek, Anlaşmalı kurumlarımız ve çözüm ortaklarımız tarafından müşterilerimize öneri sunabilmek, hizmetlerimizle ilgili müşterilerimizi bilgilendirebilmek, Hizmetlerimiz ile ilgili müşteri şikayet ve önerilerini değerlendirebilmek,  Yasal yükümlülüklerimizi yerine getirebilmek ve yürürlükteki mevzuattan doğan haklarımızı kullanabilmek amacıyla kişisel verilerinizi işleyebilmekte ve saklamaktayız. \n\nYukarıda belirtilen amaçlarla, kişisel verilerin aktarılabileceği kişi ya da kuruluşlar;  ana hissedarımız, doğrudan ve/veya dolaylı yurtiçi ya da yurtdışı iştiraklerimiz; faaliyetlerimizi yürütmek üzere hizmet aldığımız, işbirliği yaptığımız, iş ortağı kuruluşlar, Gizlilik Sözleşmesi uyarınca onay vereceğiniz ortaklar ve diğer 3. kişilerdir. \n\nKVKK’nın 11. maddesi gereği Güven Hastanesi A.Ş. ne başvurarak, kişisel verilerinizin; a) işlenip işlenmediğini öğrenme, b) işlenmişse bilgi talep etme, c) işlenme amacını ve amacına uygun kullanılıp kullanılmadığını öğrenme, d) yurt içinde ya da yurt dışında aktarıldığı 3. kişileri bilme, e) eksik ya da yanlış işlenmişse düzeltilmesini isteme, f) KVKK’nın 7. maddesinde öngörülen şartlar çerçevesinde silinmesini ya da yok edilmesini isteme, g) aktarıldığı 3. kişilere yukarıda sayılan (e) ve (f) bentleri uyarınca yapılan işlemlerin bildirilmesini isteme, h) münhasıran otomatik sistemler ile analiz edilmesi nedeniyle aleyhinize bir sonucun ortaya çıkmasına itiraz etme, i) kanuna aykırı olarak işlenmesi sebebiyle zarara uğramanız halinde zararın giderilmesini talep etme hakkına sahipsiniz. \n\n \n\nHak kullanım talebinizi iletebileceğiniz e-posta adresi ve posta adresi bilgilerimiz aşağıdaki gibidir: \n\n \n\n \n\n\nguven@guven.com.tr\n\nRemzi Oğuz Arık Mahallesi Paris Cad. No:58 Çankaya Ankara \n\n \n\n6698 sayılı Kanun ve ilgili diğer hükümlerine uygun olarak işlenmiş olmasına rağmen, işlenmesini gerektiren sebeplerin ortadan kalkması halinde kişisel veriler, şirketimiz tarafından veya talebiniz üzerine silinir, yok edilir veya anonim hale getirilir. Ancak 6563 Sayılı Elektronik Ticaretin Düzenlenmesi Hakkında Kanun uyarınca; onayın geri alındığına ilişkin kayıtlar bu tarihten itibaren 1 yıl; ticari elektronik iletinin içeriği ve gönderiye ilişkin diğer her türlü kayıt ise gerektiğinde ilgili Bakanlığa sunulmak üzere 3 yıl saklanacaktır. Süre geçtikten sonra kişisel verileriniz şirketimiz tarafından veya talebiniz üzerine silinir, yok edilir veya anonim hale getirilir.\n\nSaygılarımızla bilgilerinize sunarız. \n\nGÜVEN HASTANESİ A.Ş."),
