    "preinformation_form_context" : MessageLookupByLibrary.simpleMessage("ÖN BİLGİLENDİRME FORMU\nGüncelleme: 16.09.2021\nMADDE 1: TARAFLAR ve KONU\n1.\tİşbu Mesafeli Satış Sözleşmesi Ön Bilgilendirme Formu’nun (“Bilgilendirme Formu”) tarafları aşağıdaki gibidir: \nSATICI (“Güven Hastanesi”) \nTicari Unvanı\t: Güven Hastanesi A.Ş.\nAdresi\t\t: Remzi Oğuz Arık Mahallesi Paris Cad. No:58 Çankaya Ankara\nTelefon \t\t: 444 94 94\nE-mail \t\t: guven@guven.com.tr\nMERSİS No\t: 0451001685100012\nALICI (“Alıcı”)\nAdı Soyadı \t: <userName>\nAdresi \t\t: <adress>\nTelefon \t\t: <phoneNumber>\nE-mail \t\t: <email>\nAlıcı ve Güven Hastanesi bundan böyle ayrı ayrı “Taraf” ve birlikte “Taraflar” olarak anılabilecektir.\n2.\tGüven Hastanesi, 27166 sayı ve 11.03.2009 tarihli Resmi Gazete’de yayımlanarak yürürlüğe giren \"Özel Hastaneler Yönetmeliği\" ve sair mevzuatta belirtilen şartları taşıyan, çeşitli uzmanlık dallarında hastalara ayakta ve yatırarak muayene, teşhis ve tedavi hizmeti sunan, Ankara’da Paris Caddesi No: 58 Kavaklıdere Ankara adresinde mukim özel bir hastanedir. \n3.\tİşbu Bilgilendirme Formu 6502 Sayılı Tüketicinin Korunması Hakkında Kanun (“Kanun”) ve Mesafeli Sözleşmeler Yönetmeliği’ne uygun olarak düzenlenmiştir. İşbu Bilgilendirme Formu, Alıcı’nın Güven Hastanesi’ne ait web sitesi ve telefon uygulamaları (“Online Platform”) üzerinden işbu Bilgilendirme Formu Madde 2.2’de belirtilen sağlık hizmeti paketini (“Hizmet Paketi”) satın almasında Tarafların karşılıklı hak ve yükümlülüklerini düzenlemektedir.  \n4.\tİşbu Bilgilendirme Formu’nun Tarafları işbu Bilgilendirme Formu tahtında Kanun’dan ve Mesafeli Sözleşmeler Yönetmeliği’nden kaynaklanan yükümlülük ve sorumluluklarını bildiklerini ve anladıklarını kabul ve beyan ederler.\n5.\tAlıcı, işbu Bilgilendirme Formu’nu elektronik ortamda teyit etmekle, mesafeli sözleşmelerin akdinden önce Güven Hastanesi tarafından Alıcı’ya verilmesi gereken adres, siparişi verilen hizmete ait temel özellikler, hizmetin vergiler dahil fiyatı ve ödeme bilgilerini de doğru ve eksiksiz olarak edindiğini teyit etmiş olur.\nMADDE 2: SÖZLEŞME KONUSUNUN TEMEL NİTELİKLERİ VE BEDELİ \n1.\tHizmet Paketi’nin temel özellikleri Online Platform’da yer almaktadır ve Online Platform’da incelenebilecektir. Hizmet Paketi’nin “online görüşme” olması halinde Hizmet Paketi, hasta ve hekimin bir arada bulunması gereken durumlarda muayenenin bir muadili olmayıp, Alıcı’ya sadece Online Platform’da seçilen hekime danışma ve konsültasyon imkanı sunulacaktır. \n2.\tAlıcı tarafından işbu Bilgilendirme Formu kapsamında satın alınacak olan Hizmet Paketi’ne ilişkin bilgiler aşağıdaki şekildedir:\nHizmet Paketi Açıklaması\tAdet\tBirim Fiyatı\tAra Toplam\n(KDV Dahil)\n\t\t\t\n<packageName>\t\t\t\nToplam :\t\n\nÖdeme Şekli ve Planı\t: <paymentPlan>\nFatura Adresi\t\t: <adress>\nTeslimat Adresi\t\t: <adress>\nTeslim Edilecek Kişi\t: <userName>\nSatın Alma Tarihi\t: <currentDate>\n3.\tOnline Platform’da ilan edilen fiyatlar satış fiyatıdır. İlan edilen fiyatlar ve vaatler güncelleme yapılana ve değiştirilene kadar geçerlidir. Süreli olarak ilan edilen fiyatlar ise belirtilen süre sonuna kadar geçerlidir.\n4.\tGüven Hastanesi, Alıcı’nın Online Platform üzerinden onaylayarak satın aldığı Hizmet Paketi’ni en geç 24 saat içinde işleme alarak ilgili birimlerine iletir.\n5.\tHizmet, Güven Hastanesi tarafından mümkün olan en kısa sürede ve en geç 7 (yedi) iş günü içinde Alıcı’ya sunulur. Hizmet Paketi’nin tek seferde kullanılmakla tükenecek bir hizmete ilişkin olması halinde Hizmet Paketi’nin Alıcı tarafından <expirationDate> tarihine kadar kullanılması gerekmektedir. Hizmet Paketi’nin devamlılığı olan bir hizmete yönelik, dönemli bir hizmete ilişkin olması halinde ise Alıcı tarafından Hizmet Paketi’nin kullanımına <currentDate> tarihine kadar başlanılmış olması ve bu tarihten itibaren 3 (üç) ay içerisinde Hizmet Paketi’nin tamamen kullanılması gerekir. İşbu maddede belirtilen tarihlere kadar kullanılmayan Hizmet Paketi belirtilen tarihlerden sonra kullanılamaz ve bu hususta Alıcı’ya herhangi bir ödeme / geri ödeme yapılmayacağı gibi, Alıcı’nın herhangi bir talep hakkı da bulunmayacaktır.\n6.\tGüven Hastanesi’nden kaynaklanmayan sebeplerle gecikmelerin yaşanması halinde Güven Hastanesi durumu derhal Alıcı’ya bildirir. \n7.\tAlıcı’nın satın aldığı Hizmet Paketi’nin peşin veya vadeli fiyatı sipariş formunda yer alır, Alıcı tarafından onaylanır ve sipariş sonunda Alıcı’nın e-posta adresine e-fatura olarak gönderilir. Yapılan indirimler ve promosyonlar satış fiyatına yansıtılır.\n8.\tHizmet Paketi’nin Alıcı’ya fiziki teslimat gerektirmesi halinde, teslimat masrafları aksi Güven Hastanesi tarafından beyan edilmediği müddetçe Alıcı’ya aittir. Bu durumda Güven Hastanesi Hizmet Paketi’ni sipariş tarihinden itibaren 30 (otuz) gün içinde teslim eder. Güven Hastanesi bu süre içinde yazılı bildirimle ek 10 (on) günlük süre uzatım hakkını saklı tutar. Hizmet Paketi’nin aracı posta veya kargo şirketine teslim edilmesi ile hasardan sorumluluk Alıcı’ya geçer.\n9.\tMesafeli satış sözleşmesi Alıcı tarafından Online Platform üzerinden onaylanmakla yürürlüğe girer ve Alıcı’nın Güven Hastanesi’nden satın almış olduğu Hizmet Paketi’nin Alıcı’ya online ve/veya fiziksel ortamda sunulması ile ifa edilmiş olur. \n10.\tHizmet Paketi, Alıcı’nın sipariş formunda ve mesafeli satış sözleşmesinde belirtmiş olduğu adreste bulunan kişi/kişilere teslim edilecektir.\nMADDE 3: ALICININ BEYAN VE TAAHHÜTLERİ\n1.\tAlıcı, Hizmet Paketi’nin nitelikleri, tüm vergiler dahil satış fiyatı, ödeme şekli, teslimat ve cayma hakkı ile kullanım şartlarına ilişkin olarak ön bilgilerin tarafına ulaştığını, Güven Hastanesi tarafından kendisine Online Platform üzerinden sunulan bilgileri okuduğunu, anladığını, eksiksiz olarak bilgilendiğini, elektronik ortamda teyit ettiğini ve elektronik ortamda satış için gerekli onayları verdiğini beyan eder. \n2.\tİşbu Bilgilendirme Formu’nu kabul etmekle Alıcı, sözleşme konusu Hizmet Paketi’ni onayladığı takdirde Hizmet Paketi’nin bedeli ve vergi gibi belirtilen ek ücretleri ödeme yükümlülüğü altına gireceğini ve bu konuda bilgilendirildiğini peşinen kabul eder.\n3.\tAlıcı, seçmiş olduğu Hizmet Paketi’nin gereklerinin ifa edilebilmesi için 6698 sayılı Kişisel Verileri Koruma Kanunu uyarınca özel nitelikli kişisel veri sayılan sağlık verilerinin Hizmet Paketi kapsamındaki hizmetin ifası amacı ile sınırlı olmak kaydıyla işlenmesine açık olarak rıza göstermektedir.  \n4.\tAlıcı, talep ve şikâyetlerini Güven Hastanesi’nin yukarıda yer alan iletişim kanallarına ulaştırabilir. Güven Hastanesi, talep ve şikâyetleri değerlendirerek Alıcı’ya en kısa zamanda geri dönüş yapar. \n5.\tAlıcı, herhangi bir nedenle sözleşme konusu Hizmet Paketi’nin bedelinin ödenmemesi ve/veya banka kayıtlarında iptal edilmesi halinde, Güven Hastanesi’nin sözleşme konusu Hizmet Paketi’ni ifa ve/veya teslim yükümlülüğünün sona ereceğini kabul, beyan ve taahhüt eder.\n6.\tAlıcı, işbu Bilgilendirme Formu’nu ve mesafeli satış sözleşmesini kabul ederken en az 18 yaşında olduğunu veya ilgili ülke mevzuatına göre işbu Bilgilendirme Formu’nu ve mesafeli satış sözleşmesini akdetmeye uygun yaşta olduğunu, kısıtlı olmadığını ve işbu Bilgilendirme Formu’nu ve mesafeli satış sözleşmesini akdetmeye yetkili olduğunu kabul ve beyan eder. Alıcı’nın işbu maddede belirtilen yaş sınırından daha küçük olduğunun, kısıtlı olduğunun veya sair surette işbu Bilgilendirme Formu’nu ve/veya mesafeli satış sözleşmesini akdetmeye yetkili olmadığının tespiti halinde mesafeli satış sözleşmesi Güven Hastanesi tarafından derhal feshedilebilir ve Alıcı’ya veya yasal temsilcisine herhangi bir ödeme iadesi yapılmaz.\n7.\tHizmet Paketi’nin “online görüşme” olması halinde Alıcı’nın, randevu saatinden en geç 5 (beş) dakika önce Güven Online uygulamasına giriş yapması, bağlantıya hazır durumda olması ve hekimle görüşmeyi başlatmış olması gerekir. Alıcı’nın bu maddede belirtilen şekilde hazır olmaması ve/veya görüşmeye hiç katılmaması halinde ilgili görüşme yapılmış sayılarak ücretlendirmesi yapılır ve Alıcı’ya herhangi bir iade yapılmaz.\n8.\tHizmet Paketi’nin “online görüşme” olması halinde Alıcı’nın görüntülü görüşme yapabilmek için dikkat etmesi gereken hususlar ve hizmetin kullanılabilmesi için gereken donanım ve yazılımlara ilişkin bilgi “https://www.guven.com.tr/online-doktor” adresindeki ilgili bölümlerde yer almakta olup, bu hususlar zaman zaman Güven Hastanesi tarafından güncellenebilecektir. Güncellemeleri takip etmek ve bu hususlara uymak Alıcı’nın sorumluluğundadır.\n9.\tAlıcı, Ek-1: Online Doktor ve E-Konsültasyon Hizmetinin Kapsamı Hakkında Bilgilendirme ve Aydınlatılmış Onam Belgesi’nde yer alan bilgileri okuduğunu, anladığını ve kabul ettiğini beyan ve taahhüt eder.\nMADDE 4: İFADA SIRA, TEMERRÜD HALİ VE HUKUKİ SONUÇLARI\n1.\tAlıcı’nın ödemeyi gerçekleştirmesini takiben, mesafeli satış sözleşmesi koşullarına uygun olarak Güven Hastanesi işbu Bilgilendirme Formu’nda ve mesafeli satış sözleşmesinde belirtilen Hizmet Paketi kapsamındaki hizmeti sunar. \n2.\tAlıcı borcundan dolayı temerrüde düşmesi halinde, borcun gecikmeli ifasından dolayı Güven Hastanesi’nin oluşan zarar ve ziyanını ödemeyi kabul eder.\nMADDE 5: CAYMA HAKKI\n1.\tAlıcı, hiçbir hukuki ve cezai sorumluluk üstlenmeksizin ve hiçbir gerekçe göstermeksizin, mal satışına ilişkin işlemlerde teslimat tarihinden itibaren, hizmet satışına ilişkin işlemlerde satın alma tarihinden itibaren 14 (on dört) gün içerisinde cayma hakkını kullanabilir. Mal satışına ilişkin işlemlerde Alıcı, malın teslimine kadar olan süre içinde de cayma hakkını kullanabilir. \n2.\tHizmet Paketi kapsamındaki hizmetin Alıcı tarafından kısmen veya tamamen kullanılmış olması halinde cayma hakkı kullanılamaz. Cayma hakkı süresi sona ermeden önce, Alıcı’nın onayı ile ifasına başlanan hizmetler için de cayma hakkı kullanılamaz.\n3.\tAlıcı’nın cayma hakkını kullanmasından itibaren 14 (on dört) gün içerisinde (mal satışına ilişkin işlemlerde malın Güven Hastanesi’nin iade için belirttiği taşıyıcı aracılığıyla geri gönderilmesi kaydıyla), Alıcı’nın ilgili mal veya hizmete ilişkin Güven Hastanesi’ne yaptığı tüm ödemeler Alıcı’ya Hizmet Paketi’ni satın alırken kullandığı ödeme aracına uygun bir şekilde ve Alıcı’ya herhangi bir masraf veya yükümlülük getirmeden ve tek seferde iade edilecektir.\n4.\tCayma hakkına ilişkin bildirimler Güven Hastanesi’ne ait <hospitalEmail> e-posta adresine yapılacaktır.\n5.\tCayma hakkının kullanımından kaynaklanan masraflar Güven Hastanesi’ne aittir. Alıcı, işbu Bilgilendirme Formu’nu ve mesafeli satış sözleşmesini kabul etmekle, cayma hakkı konusunda bilgilendirildiğini peşinen kabul eder.\nMADDE 6: SORUMLULUK SINIRI \n1.\tAlıcı’nın her durumda tıbbi tanı, tedavi ve hastalıkların önlenmesi için özgür iradesiyle seçeceği hekimine başvurması, kontrollerini aksatmaması ve her türlü acil durumda vakit kaybetmeden en yakın acil servise müracaat etmesi gerekmektedir. Aksi halde Güven Hastanesi’nin hiçbir sorumluluğu bulunmamaktadır.\n2.\t“Online görüşme” kapsamında Güven Online’da yer alan hekimler tarafından Alıcı’ya herhangi bir tıbbi işlem (muayene, tanı, teşhis, tedavi gibi) sunulmamakta ve vaat edilmemekte olup; Güven Hastanesi’nin ve/veya Güven Online’da yer alan hekimlerin tıbbi kötü uygulamadan (malpraktis) dolayı herhangi bir sorumluluğu bulunmayacaktır.\n3.\t“Online görüşme” kapsamında Güven Online’da yer alan hekimler, herhangi bir görüşte bulunmuş olmamaktadır. “Online görüşme” kapsamında sunulan herhangi bir bilgi veya verinin doğruluğunu teyit etmek Alıcı’nın yükümlülüğü ve sorumluluğundadır. “Online görüşme” kapsamında Güven Hastanesi ve Güven Online’da yer alan hekimler, Güven Online’ın ve/veya “online görüşme” özelliğinin kullanılması veya kullanılmaması, Güven Online’da sunulan hizmetin aksaması veya kesintiye uğraması ve mesafeli satış sözleşmesindeki hizmetlerin ifası nedeniyle ortaya çıkabilecek herhangi bir yaralanma, bedensel zarar, maddi veya manevi zarar, kâr kaybı, iş kaybı veya sair her türlü doğrudan ya da dolaylı zararlardan hiçbir biçimde sorumlu değildir.\n4.\tUygulanacak hukuk altında izin verildiği ölçüde, Güven Hastanesi’nin Alıcı’nın Hizmet Paketi ve mesafeli satış sözleşmesi kapsamındaki herhangi bir zararına ilişkin sorumluluğu, hangisi daha az ise; (i) sorumluluğu doğuran olaydan önceki 1 (bir) takvim ayı içinde Alıcı tarafından “Güven Online üzerinden” Güven Hastanesi’ne ödenmiş olan Hizmet Paketi bedelleri toplamı, veya (ii) 1.000 (bin) Türk Lirası ile sınırlıdır.\n5.\tAlıcı’nın mesafeli satış sözleşmesini ihlal ederek üçüncü kişilerin herhangi bir zararına sebep olması halinde Alıcı, bu zarardan Güven Hastanesi’ni masun tutacaktır. Alıcı’dan kaynaklanan herhangi bir sebeple Güven Hastanesi’nin herhangi bir zarara uğraması halinde bu zarar Alıcı tarafından derhal nakden ve defaten tazmin edilecektir.\nMADDE 7: DİĞER HÜKÜMLER\n1.\tMesafeli satış sözleşmesi tahtında Taraflar arasında yapılacak her türlü yazışma, mevzuatta sayılan zorunlu haller dışında e-posta aracılığıyla yapılır. Mevzuatta yazılı hallerde Tarafların belirtmiş olduğu adresleri tebligat adresleri olarak kabul edilir. 15 (on beş) gün içerisinde karşı Tarafa bildirilmeyen tebligat adresi değişikliklerinde tebligat usulüne uygun olarak yapılmış sayılır.\n2.\tGüven Hastanesi, kendi kontrolü dışında meydana gelen, öngörülemeyen ve önlenemeyen doğal afetler, yangın, patlamalar, iç savaşlar, savaşlar, ayaklanmalar, halk hareketleri, seferberlik ilanı, grev, lokavt ve salgın hastalıklar gibi mücbir sebep hallerinden dolayı oluşabilecek herhangi bir gecikme veya yükümlülüklerin ifa edilememesinden kaynaklanabilecek zarar ve ziyandan sorumlu olmayacaktır. Mücbir sebep halinin Güven Hastanesi’nin mesafeli satış sözleşmesinde yazılı yükümlülüklerini doğrudan etkilemesi durumunda Güven Hastanesi’nin mesafeli satış sözleşmesini tazminatsız ve tek taraflı feshetme hakkı saklıdır.\n3.\tBu Bilgilendirme Formu’nun ve/veya mesafeli satış sözleşmesinin herhangi bir madde veya kısmının geçersiz, hükümsüz veya ifa edilemez sayılması halinde, o madde veya kısım, onun lafzi amacına en yakın ve aynı zamanda ifa edilebilir olan bir şekilde ve kapsamda yorumlanacak ve uygulanacaktır; ancak bunun mümkün olmaması halinde, o madde veya kısım Bilgilendirme Formu’nda ve/veya mesafeli satış sözleşmesinden ayrılmış ve çıkartılmış sayılacak ve bu durum, Bilgilendirme Formu’nun ve/veya mesafeli satış sözleşmesinin kalan madde ve hükümlerini hiçbir şekilde etkilemeyecek veya geçersiz hale getirmeyecek ve Bilgilendirme Formu’nun ve mesafeli satış sözleşmesinin diğer madde ve hükümleri tam geçerli ve yürürlükte kalmaya devam edecektir.\n4.\tHiçbir feragat yazılı olarak ve Taraflarca yapılmadıkça geçerli olmayacaktır. Taraflardan herhangi birinin mesafeli satış sözleşmesinin herhangi bir hükmünün veya şartının sağlanmasını talep etmemesi ya da herhangi bir Tarafın mesafeli satış sözleşmesinin herhangi bir ihlalinden doğan talep hakkından feragat etmesi, söz konusu hüküm veya şartın bundan sonra uygulanmasını engellemeyecektir ve bir sonraki ihlalden feragat olarak sayılmayacaktır.\n5.\tGüven Hastanesi, mesafeli satış sözleşmesinden doğan hak ve yükümlülüklerini hiçbir sınırlama olmaksızın üçüncü şahıslara devretmek hakkını haizdir.\n6.\tTaraflar, Bilgilendirme Formu’nun ve mesafeli satış sözleşmesinin geçerliliği, uygulanması ve yorumlanması konusunda kanunlar ihtilafına dair kurallar hariç olmak üzere münhasır şekilde Türkiye Cumhuriyeti yasaları ve ilgili mevzuatının uygulanacağını kabul ve beyan ederler.\n7.\tBilgilendirme Formu ve mesafeli satış sözleşmesi ile ilgili çıkacak ihtilaflarda; her yıl Ticaret Bakanlığı tarafından ilan edilen değere kadar Alıcı’nın yerleşim yerindeki Hizmet Paketi’ni satın aldığı veya ikametgâhının bulunduğu yerdeki İl veya İlçe Tüketici Sorunları Hakem Heyetleri, söz konusu değerin üzerindeki ihtilaflarda ise Tüketici Mahkemeleri yetkilidir.\n8.\tBilgilendirme Formu ve mesafeli satış sözleşmesinden doğabilecek ihtilaflarda Güven Hastanesi’nin resmi defter ve ticari kayıtlarıyla, kendi veritabanında, sunucularında tuttuğu elektronik bilgiler ve bilgisayar kayıtları, bağlayıcı, kesin ve münhasır delil teşkil eder. Bu madde Hukuk Muhakemeleri Kanunu’nun 193. maddesi anlamında delil sözleşmesi niteliğindedir.  \n9.\tALICI, GÜVEN ONLINE VE SÖZLEŞME KAPSAMINDAKİ HİZMETİN NİTELİKLERİ VE BEDELİ İLE EK-1: ONLINE DOKTOR VE E-KONSÜLTASYON HİZMETİNİN KAPSAMI HAKKINDA BİLGİLENDİRME VE AYDINLATILMIŞ ONAM BELGESİ’NDEKİ HUSUSLARA İLİŞKİN OLARAK GÜVEN HASTANESİ TARAFINDAN KENDİSİNE YAPILAN BİLGİLENDİRMELERİ VE KENDİ SORUMLULUKLARINI OKUYUP ANLADIĞINI, ANLAMADIĞI KISIMLARIN OLMASI HALİNDE SORU SORDUĞUNU, SORULARININ YETKİLİ KİŞİLERCE CEVAPLANDIĞINI, EKSİKSİZ OLARAK BİLGİLENDİĞİNİ KABUL VE BEYAN EDER.\n7 (yedi) maddeden ve 1 (bir) adet ekten ibaret işbu Bilgilendirme Formu, Alıcı tarafından elektronik ortamda okunup onaylanmak suretiyle akdedilmiş ve derhal yürürlüğe girmiştir.\n\nEk-1: Online Doktor ve E-Konsültasyon Hizmetinin Kapsamı Hakkında Bilgilendirme ve Aydınlatılmış Onam Belgesi\n\nALICI\t                          GÜVEN HASTANESİ A.Ş.\n\n \nEK-1:\nONLINE DOKTOR VE E-KONSÜLTASYON\nHİZMETİNİN KAPSAMI HAKKINDA BİLGİLENDİRME\nVE\nAYDINLATILMIŞ ONAM BELGESİ\nGüncelleme: 03.04.2020\n\nGüven Hastanesi A.Ş.’ye (“Güven Hastanesi”) ait web sitesi ve telefon uygulamaları (“Online Platform”) üzerinden sunulan ONLINE DOKTOR VE E-KONSÜLTASYON HİZMETİ’nin (“Hizmet”) kapsamı konusunda tarafıma yazılı bilgilendirme yapılmıştır. \n1.\tHizmet kapsamında, Online Platform üzerinden Güven Hastanesi hekimleri tarafından danışma ve konsültasyon imkanı sunulacağı; \n2.\tHizmet’in hasta ve hekimin bir arada bulunmasını gerektiren durumlarda muayenenin muadili olmadığı; \n3.\tHer türlü tıbbi tanı ve tedavi ihtiyaçlarım için özgür irademle seçeceğim hekimime başvuru yapmam ve fiziken muayene olmam gerektiği, \n4.\tSağlığımı ilgilendiren ve aciliyeti olan konularda, vakit kaybetmeden en yakın acil servise müracaat etmem gerektiği, \n5.\tAksi halde gerçekleşebilecek olumsuz sonuçlardan Güven Hastanesi’nin hiçbir şekilde sorumlu tutulamayacağı, \nkonularında yazılı olarak aydınlatıldım. \nKonu hakkında sorum olması halinde ulaşabileceğim iletişim numaraları tarafımla paylaşıldı. \nGelinen aşamada; \nTarafıma yapılan tüm yazılı bilgilendirmeleri okuduğumu, anladığımı ve bu haliyle kabul ettiğimi; ONLINE DOKTOR VE E-KONSÜLTASYON HİZMETİ’nden bu bilgilendirmeler doğrultusunda yararlanacağımı kabul ve beyan ediyorum.\n(İşbu Belge GÜVEN HASTANESİ ile ALICI arasındaki MESAFELİ SATIŞ SÖZLEŞME’sinin tamamlayıcı bir parçası olarak ALICI’ya imzalatılmıştır.)\n\n\n"),
